const apiDomain = 'http://127.0.0.1:8000';

//Authentication Endpoints
export const loginApiUrl = `${apiDomain}/accounts/api/auth/login`;
export const registerUserApiUrl = `${apiDomain}/accounts/api/auth/register`;
export const logoutApiUrl = `${apiDomain}/accounts/api/auth/logout`;
